// The TInput object.
var tInput = WScript.CreateObject ( "Tester.TInput" ) ;
// The TSystem object.
var tSystem = WScript.CreateObject ( "Tester.TSystem" ) ;
// The shell object.
var WshShell = WScript.CreateObject ( "Wscript.Shell" ) ;

// A general TWindow object.
var tWin ;
// A general child TWindow object.
var tChildWin ;


tInput.AbsoluteScreenCoordinates = true

// Start up PaintBrush.
WshShell.Run ( "PBRUSH.EXE" ) ;
// Sleep a bit to let it get started.
tSystem.Pause ( 2000 ) ;

// Find the window and set focus to it.
