tWin.SetForegroundTWindow ( ) ;
tWin.SetWindowSize ( 0 , 0 , 1024 , 768 ) ;

// Set the image size to 1000x1000 so I have enough room to draw
tInput.PlayInput ( "{ALT DOWN}i{ALT UP}a1000{TAB}1000~" ) ;

